T_TIPO_DATA(7432004,'07','01','TDDJA-000024-Falta testimonio de la resolución del juez del concurso.','','01','')
		); 
    V_TMP_TIPO_DATA T_TIPO_DATA;
    
BEGIN	
	
    DBMS_OUTPUT.PUT_LINE('[INICIO] ');


    FOR I IN V_TIPO_DATA.FIRST .. V_TIPO_DATA.LAST
      LOOP
      
        V_TMP_TIPO_DATA := V_TIPO_DATA(I);
    	ACT_NUM_ACTIVO := TRIM(V_TMP_TIPO_DATA(1));
       	EXECUTE IMMEDIATE 'SELECT COUNT(1) FROM '||V_ESQUEMA||'.ACT_ACTIVO WHERE ACT_NUM_ACTIVO = '||ACT_NUM_ACTIVO INTO V_KOUNT;
  			  
		IF V_KOUNT > 0 THEN 
	  			  
			EXECUTE IMMEDIATE 'SELECT ACT_ID FROM '||V_ESQUEMA||'.ACT_ACTIVO WHERE ACT_NUM_ACTIVO = '||ACT_NUM_ACTIVO INTO ACT_ID;
	
			V_SQL := 'INSERT INTO '||V_ESQUEMA||'.'||V_TABLA_1||' (ACT_CAN_ID, ACT_ID, DD_MCN_ID, DD_CAN_ID, CAN_DESCRIPCION, ACT_FECHA_SUBSANACION, FECHACREAR, USUARIOCREAR, VERSION, BORRADO, DD_EMN_ID, DD_RSU_ID, AHT_ID)
					  SELECT '||V_ESQUEMA||'.S_ACT_CAN_CALIFICACION_NEG.NEXTVAL, 
					  	  '''||ACT_ID||''', 
					  	  (SELECT DD_MCN_ID FROM '||V_ESQUEMA||'.DD_MCN_MOTIVO_CALIFIC_NEG WHERE DD_MCN_CODIGO = '''||V_TMP_TIPO_DATA(2)||'''),
					  	  (SELECT DD_CAN_ID FROM '||V_ESQUEMA||'.DD_CAN_CALIFICACION_NEG WHERE DD_CAN_CODIGO = '''||V_TMP_TIPO_DATA(3)||'''),
					  	  '''||V_TMP_TIPO_DATA(4)||''',
					  	  '''||V_TMP_TIPO_DATA(5)||''',
					  	  SYSDATE,
					  	  '''||V_USUARIO||''',
					  	  0,
						  0,
						  (SELECT DD_EMN_ID FROM '||V_ESQUEMA||'.DD_EMN_ESTADO_MOTIVO_CAL_NEG WHERE DD_EMN_CODIGO = '''||V_TMP_TIPO_DATA(6)||'''),
						  (SELECT DD_RSU_ID FROM '||V_ESQUEMA||'.DD_RSU_RESPONSABLE_SUBSANAR WHERE DD_RSU_CODIGO = '''||V_TMP_TIPO_DATA(7)||'''),
						  (SELECT AHT_ID FROM (SELECT AHT.AHT_ID, ROW_NUMBER() OVER(
       						PARTITION BY TIT.TIT_ID
        						ORDER BY AHT.AHT_FECHA_CALIFICACION DESC 
    							) ROW_NUM
    							FROM '||V_ESQUEMA||'.ACT_AHT_HIST_TRAM_TITULO AHT 
    							JOIN '||V_ESQUEMA||'.ACT_TIT_TITULO TIT ON TIT.TIT_ID = AHT.TIT_ID 
    							WHERE TIT.ACT_ID = '''||ACT_ID||''') WHERE ROW_NUM = 1)
					  	  FROM DUAL';

			EXECUTE IMMEDIATE V_SQL;
			
			DBMS_OUTPUT.PUT_LINE('INSERTADO EL ACTIVO '||ACT_NUM_ACTIVO||' EN '||V_TABLA_1);
			
			V_COUNT_UPDATE := V_COUNT_UPDATE + 1;
				
		ELSE
			
			DBMS_OUTPUT.PUT_LINE('[INFO] El activo '||ACT_NUM_ACTIVO||' no existe!');
			
		END IF;
		
      END LOOP;
    COMMIT;

    DBMS_OUTPUT.PUT_LINE('[INFO] Se han insertado en total '||V_COUNT_UPDATE||' registros en la tabla '||V_TABLA_1);
   

EXCEPTION
     WHEN OTHERS THEN
          err_num := SQLCODE;
          err_msg := SQLERRM;

          DBMS_OUTPUT.put_line('[ERROR] Se ha producido un error en la ejecución:'||TO_CHAR(err_num));
          DBMS_OUTPUT.put_line('-----------------------------------------------------------'); 
          DBMS_OUTPUT.put_line(err_msg);

          ROLLBACK;
          RAISE;          

END;
/
EXIT
